script: |
  super -f text -I q1229.spq | sort > q1229.out

inputs:
  - name: q1229.spq
    data: |
      SELECT - + col1 * - + 23 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT col2 + col1 * CAST ( NULL AS INTEGER ) * + col0 * + col0 * + col2 / col2 BETWEEN + col1 AND NULL;
  - name: tab2

outputs:
  - name: q1229.out
    data: |
